description:
Russia on Four Wheels

Travel Documentary hosted by Anita Rani and Justin Rowlatt, published by BBC in 2014 - English narration


Information
------------------------------

Justin Rowlatt and Anita Rani set off across Russia on two massive road-trips across the world's biggest, and one of its most enigmatic countries, Russia. Driving thousands of miles in three weeks, and in two very different cars, Justin and Anita begin their journeys in Sochi, the Black Sea resort home to the 2014 Winter Olympics. Anita is out to discover 'new' Russia. She travels north and west from Sochi in a Kombat, a Russian built luxury armoured plated bling machine - her oligarch tank. She enters a thriving world of westernised entrepreneurs, the mega-rich and rebellious youth, people who are at the forefront of shaping a new and vibrant Russia. Meanwhile Justin heads east into 'old' Russia where he encounters a very different world in his chosen vehicle: a slightly battered Soviet-built UAZ 'jeep' first designed in the 1940s for the Red Army. He meets traditional Russians and encounters a land that seems hardly to have changed since before the Cold War years.

